'%{
\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYoung finance professionals need to familiarize themselves with the history of banking, and recognize that it is at its best when it serves ever-broadening spheres of society.\n\nApril 8, 2016\n\u001c13\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cToday, the best way forward is to update financial and communications technology to offer a full array of enlightened banking services to the lower middle class and the poor.\n\nApril 8, 2016\n\u001c13\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGraduates going into mortgage banking are faced with a different, but equally vital, challenge: to design new, more flexible loans that will better help homeowners to weather the kind of economic turbulence that has buried millions of people today in debt. Young investment bankers, for their part, have a great opportunity to devise more participatory forms of venture capital—embodied in the new crowd-funding Web sites—to spur the growth of innovative new small businesses.\n\nApril 8, 2016\n\u001c13\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFinance, at its best, does not merely manage risk, but also acts as the steward of society’s assets and an advocate of its deepest goals. Beyond compensation, the next generation of finance professionals\n\nApril 8, 2016\n\u001c14\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwill be paid its truest rewards in the satisfaction that comes with the gains made in democratizing finance—extending its benefits into corners of society where they are most needed. This is a new challenge for a new generation, and will require all of the imagination and skill that you can bring to bear. Good luck in reinventing finance. The world needs you to succeed.\n\nApril 8, 2016\n\u001c14\n\u0011\n\u0011\n\n\nPreface\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdesigning new financial inventions that take account of the most up-to-date financial theory, as well as the research revolution in behavioral economics and behavioral finance that has explored the real human limitations that inhibit rational and humane decision making. Creating and implementing such inventions will be the best tactic to deal with economic inequality. This future is in the hands of the people, old as well as young, who might read this book\n\nApril 8, 2016\n\u001c17\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cfinance remains an essential social institution, necessary for managing the risks that enable society to transform creative impulses into vital products and services, from improved surgical protocols to advanced manufacturing technologies to sophisticated scientific research enterprises to entire public welfare systems. The connections between financial institutions and individual people are fundamental for society. Clarifying the terms of these connections and\n\nApril 8, 2016\n\u001c21\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cestablishing a proper context for implementing and enhancing them is the subject of this book.\n\nApril 8, 2016\n\u001c21\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cInnovations could include the implementation of new and better safeguards against economic depression, including the proliferation of new kinds of insurance contracts to allow people to be more adventuresome in their lives without fear of economic catastrophe. We could also see innovative measures developed to curtail the rising plague of economic\n\nApril 8, 2016\n\u001c23\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cinequality that threatens to create serious social problems in our society.\n\nApril 8, 2016\n\u001c24\n\u0011\n\u0011\n\n\nIntroduction: Finance, Stewardship, and Our Goals\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOur capitalist institutions do not yet fully live up to this ideal, but throughout history there has been a long trend toward the democratization of finance, the opening of financial opportunities to everyone. It is a trend we must hope will continue into the future. It is true that social barriers prevent some from realizing, and profiting from, their talents. An illiterate farm boy from a remote area finds it difficult to walk into the offices of a bank in a big city to ask for capital to start a business. There is a very real barrier to such people’s accessing capital, and there is substantial evidence of such a barrier in the extreme variation in interest rates paid by borrowers in different regions and different categories. Development economist Esther Duflo summarizes: “This body of evidence makes it very hard to believe that credit markets, at least in the developing world, are anywhere near the ideal market that would make the\n\nApril 9, 2016\n\u001c33\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1bABWg4Uj0yVVg70eMK52wMtGmxN4j_H21aP94us","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1yvcnLfxLdM7ao1F_1kLznCv8MlgSZUwy10MABhU","i_cont":0.0,"i_opa":1.0