e,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":3539,"ei":3553,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":3554,"ei":3562,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":3563,"ei":3623,"sm":{"ts_ff_i":false,"ts_it":true,"ts_bd_i":false,"ts_fs":16.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bd":false,"ts_fs_i":false}},{"ty":"as","st":"text","si":3624,"ei":4573,"sm":{"ts_ff_i":false,"ts_it":true,"ts_va":"nor","ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4574,"ei":4588,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4589,"ei":4594,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="fh+YwApkOCUi7R37862hPnbzk3c"  nonce="fh+YwApkOCUi7R37862hPnbzk3c">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="fh+YwApkOCUi7R37862hPnbzk3c"  nonce="fh+YwApkOCUi7R37862hPnbzk3c">DOCS_modelChunk = [{"ty":"is","ibi":4595,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdistribution of wealth irrelevant for investment.” 7 But this is not a fundamental problem of financial capitalism. It is rather a problem of democratizing and humanizing and expanding the scope of financial capitalism .\n\nApril 9, 2016\n\u001c33\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAt its broadest level, finance is the science of goal architecture—of the structuring of the economic arrangements necessary to achieve a set of goals and of the stewardship of the assets needed for that achievement. The goals may be those of households, small businesses, corporations, civic institutions, governments, and of society itself. Once an objective has been specified—such as payment for a college education, a couple’s comfortable retirement, the opening of a restaurant, the addition of a new wing on a hospital, the creation of a social security system, or a trip to the moon—the parties involved need the right financial tools, and often expert guidance, to help achieve the goal. In this sense, finance is analogous to engineering\n\nApril 9, 2016\n\u001c34\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccurious and generally overlooked fact that the very word finance actually derives from a classical Latin term for “goal.” The dictionary tells us that the word derives from the classical Latin word finis ,\n\nApril 9, 2016\n\u001c35\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwhich is usually translated as end or completion . One dictionary notes that finis developed into the word finance since one aspect of finance is the completion, or repayment, of debts. But it is convenient for our purposes to recall that finis , even in ancient times, was also used to mean “goal,” as with the modern English word end .\n\nApril 9, 2016\n\u001c35\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFinance does not embody a goal. Finance is not about “making money” per se. It is a “functional” science in that it exists to support other goals—those of the society. The better aligned a society’s financial institutions are with its goals and ideals, the stronger and more successful the society will be.\n\nApril 9, 2016\n\u001c35\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn addition, finance involves discovery of the world and its opportunities, which ties it in to information technology. Whenever there is trading, there is price discovery—that is, the opportunity to learn the market value of whatever is being traded. This in turn involves the revelation of people’s feelings and motivations, and of the opportunities that exist among groups of people, which may in turn make even more ambitious goals possible.\n\nMay 6, 2016\n\u001c37\n\u0011\n\u0011\n\n\nPart One: Roles and Responsibilities\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cT he CEO of a company is in a very special position, because he or she stands for an idea—the core idea behind the company’s activities, a way of thinking that defines the work of all the company’s employees, and a culture that includes its corporate values, connecting the company to the larger society. The CEO is responsible for the formulation of short-run goals that promote that very idea. The CEO embodies the purpose of the company. This responsibility has to be put, to a significant extent, into the hands of an individual and not a committee of equals, just as the writing of\n\nApril 10, 2016\n\u001c50\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ca novel usually has to be put into the hands of one individual.\n\nApril 10, 2016\n\u001c50\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe still need the prefrontal cortex of one individual—however it may work—coordinating the activities of large groups of people. Large groups of people cannot be strategic or purposeful if they are leaderless\n\nApril 10, 2016\n\u001c50\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA CEO typically serves for only a few years, during which time she or he has to set goals for a company that is much longer lived than the CEO’s own tenure. Thus there has to be an effective reward system that focuses the CEO on the long term. And this is a problem that lends itself to financial solutions\n\nApril 10, 2016\n\u001c50\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cless-developed countries, where there are fewer analysts, rating agencies, and newspapers and magazines to provide evaluation of investments. Hence banking plays an even bigger role in the economies of less-developed countries. 5\n\nApril 14, 2016\n\u001c83\n\u0011\n\u0011"},{"ty":"te","id":"i.12","spi":4604},{"ty":"te","id":"i.13","spi":4859},{"ty":"te","id":"i.14","spi":5641},{"ty":"te","id":"i.15","spi":5881},{"ty":"te","id":"i.16","spi":6253},{"ty":"te","id":"i.17","spi":6594},{"ty":"te","id":"i.18","spi":7111},{"ty":"te","id":"i.19","spi":7733},{"ty":"te","id":"i.20","spi":7832},{"ty":"te","id":"i.21","spi":8076},{"ty":"te","id":"i.22","spi":8418},{"ty":"as","st":"paragraph","si":4595,"ei":4595,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4596,"ei":4596,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":4597,"ei":4597,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":4599,"ei":4599,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":4601,"ei":4601,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":4603,"ei":4603,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"ce