0000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8387,"ei":8402,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":8421,"ei":8651,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8652,"ei":8667,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="fh+YwApkOCUi7R37862hPnbzk3c"  nonce="fh+YwApkOCUi7R37862hPnbzk3c">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="fh+YwApkOCUi7R37862hPnbzk3c"  nonce="fh+YwApkOCUi7R37862hPnbzk3c">DOCS_modelChunk = [{"ty":"is","ibi":8674,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut together they do in general have the effect of making markets more orderly and prices more reflective of true value. In the current environment the greatest hostility is often reserved for the traders, since they usually do not present themselves as helping society in any direct way. They are just buying and selling to try to make money for themselves. Their activities remind people of gambling—and the successes of some who excel in trading can be galling. Traders are very different from investment managers who manage large portfolios of investments, who set portfolios on their course for years on behalf of clients and their long-term goals. Traders put themselves at risk every minute of every day, and for no one’s benefit but their own.\n\nMay 28, 2016\n\u001c105\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe existence of traders allows financial markets to respond almost instantly to new developments. When the price of a share of stock goes up, those who had bet on that stock are rewarded. Because of traders’ activities, the reward is virtually instantaneous, and it serves to encourage similar activities again and again\n\nMay 28, 2016\n\u001c107\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe markets that traders make are a “valuation machine” that assesses the value of various actions in a constantly changing environment and that gives nearly instant feedback and corrections in the form of meaningful price movements\n\nMay 28, 2016\n\u001c107\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMay 28, 2016\n\u001c110\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFar more important than high- frequency trading is trading of a broader scope —trading of more different kinds of things. The scope of trading has been gradually increasing over the past century. But progress has been slow, and still there are some extremely important assets for which there are no liquid markets. With the advent of high-scope trading, many more things are traded. An example would be the “prediction markets” that set prices based on the probabilities that a specified event will transpire.\n\nMay 28, 2016\n\u001c110\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJune 13, 2017\n\u001c112\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe problem at the time was that our contracts didn’t become liquid enough to attract attention.\n\nMay 28, 2016\n\u001c112\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo start an important new market, you need liquidity. To have liquidity, you need an important market. Market makers can sometimes create new markets, despite the chicken-or-egg problem, if they have enough capital and courage and commitment to make the market work. But it is a slow process, and we still have relatively few markets for individual fundamentals\n\nMay 28, 2016\n\u001c112\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe public disgust with financial machinations is enormous right now, and such ideas are met with great skepticism. Many of those who object seem to think that such new markets would only create opportunities for bad behavior. But I find it ironic that no one (that I have ever heard) advocates shutting down trading in the major markets that already exist, like the stock market or the bond market. They don’t suggest this because the importance of this type of trading in our existing economy is just too great. So how does one draw the line between “good trading” and “bad trading”? If trading of claims on corporate profits (trading stocks) is a good thing, then why isn’t trading for claims on GDP likewise good? Corporate profits are, after all, just a (small) component of GDP.\n\nMay 28, 2016\n\u001c113\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThey do not seem to realize that the financial crisis was not primarily caused by a spontaneous outbreak of moral turpitude, but by a failure to appreciate and manage risks (notably real estate risk)\n\nApril 30, 2016\n\u001c114\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLife insurance was invented in the 1600s, but initially only a few financially sophisticated people bought it. The same was true of fire insurance. It was not until the nineteenth and twentieth centuries that these kinds of insurance became widespread in advanced countries. And they still have not penetrated to many poorer regions of the world. The first imperative is to get a far broader segment of the public covered by existing, well-understood policies. For example, the fundamental tragedy of the Haitian earthquake of 2010, even including the loss of life, was that few buildings were insured there. This meant not only that there was no compensation for damage but also that there had been no insurance companies overseeing building codes in years past—a practice that certainly would have reduced damage and loss of life. The Caribbean Catastrophe Risk Insurance Facility had since 2007 tried to establish better property insurance practices in Haiti, as well as other countries in the region, but it had made little headway when the earthquake of 2010 struck. This magnitude 7.0 earthquake caused at least fifty thousand deaths. In contrast, the\n\nApril 30, 2016\n\u001c117\n\u0011\n\u0011"},{"ty":"te","id":"i.23","spi":8683},{"ty":"te","id":"i.24","spi":9469},{"ty":"te","id":"i.25","spi":9825},{"ty":"te","id":"i.26","spi":10092},{"ty":"te","id":"i.27","spi":10125},{"ty":"te","id":"i.28","spi":10669},{"ty":"te","id":"i.29","spi":10703},{"ty":"te","id":"i.30","spi":10834},{"ty":"te","id":"i.31","spi":11230},{"ty":"te","id":"i.32","spi":12049},{"ty":"te","id":"i.33","spi":12285},{"ty":"as","st":"paragraph","si":8674,"ei":8674,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":8675,"ei":8675,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":8676,"ei":8676,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":8678,"ei":8678,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":8680,"ei":86