usly damage their crops, causing massive hardship or even starvation. It has been estimated that about a billion people in the world have an income of less than one dollar a day, and that three-quarters of them live in rural areas that are heavily dependent on agriculture. 1 For these people the risk of crop failure is paramount, and this risk can be a life-or-death one. Foreign emergency aid tends to reach them too late, after they have already been forced to sell off their meager assets and slaughter their livestock just to survive. Primitive societies try to manage the risk of crop loss by risk sharing within the family. 2 But in practice all members of a family may be affected by the same crop failure, so this approach to risk management is far from ideal.\n\nApril 30, 2016\n\u001c117\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis would be a long-term insurance policy that an individual could purchase on a career, an education, or a particular investment in human capital. One could choose to specialize far more narrowly than is commonly done today—say, on a particularly interesting career direction—developing the expertise for such a career without fear of the consequences if the initiative turned out badly. The insurance policy would pay off with a supplement to one’s lifetime income if it turned out years or decades later, based on verifiable data, that there was less of a market, or even no market at all, for people with this career.\n\nApril 30, 2016\n\u001c119\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cRonnie Horesh has proposed “social policy bonds,” issued by governments, that would pay out more if certain social policy objectives were met, thereby creating a financial incentive for free-market participants to buy the bonds and then figure out how to meet the objectives. 3\n\nApril 30, 2016\n\u001c124\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c1825, a newspaper article noted the profound importance of the search problem: “Experience proves that thousands lead a life of celibacy, not from choice but prudence, and the reason is obvious: it is because of a limited circle of acquaintance, persons of suitable age, disposition and circumstances cannot be found. We daily hear of unhappy differences after marriage, owing to the great dis-proportion of age, disposition, \u0026 c., which, if there were more facility afforded to become acquaint\n\nApril 30, 2016\n\u001c125\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEven these early businesses must have helped people with the market problem of finding a matched trade, that is, finding a person who not only is suitable but also thinks you suitable in turn. Indeed, finding a coincidence of wants is one of the most painful and difficult aspects of dating. Perhaps the administrators of these plans could have helped people lessen the pain and speed the conclusion if they had used their experience in matching in a way that did not force people to search slowly and sequentially through a list of those who\n\nApril 30, 2016\n\u001c126\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwere for the most part uninterested\n\nApril 30, 2016\n\u001c126\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe strongest force shaping politics is not blood or money, but ideas.” 8 That is why the wealthy often prefer to sponsor partisan think tanks rather than lobbyists. But even think tanks are successful only insofar as they can make their ideas work in practice.\n\nApril 30, 2016\n\u001c151\n\u0011\n\u0011\n\n\nPart Two: Finance and Its Discontents\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“To have done anything by which you earned money merely is to have been truly idle or worse.” The key word in this sentence is merely . 5\n\nMay 3, 2016\n\u001c210\n\u0011\n\u0011"}
}'


